import './FloatingDiv.css';

const FloatingDiv = ({image, text1,text2}) =>{
    return  (
<div className='floatingDiv'>
    <img src={image} alt='' />
    <span>
        {text1} <br/>
        {text2}
    </span>
</div>
    );
}
export default FloatingDiv ;
